	(11,26,'浙江元丰纺织股份有限公司',NULL,NULL,0,0,0,'盛泽镇市场东路七商区12-13号','86','512','63099930','86','512','63099930','沈 先生','139 5736 0382','<p>厂址：浙江嘉兴王江泾开发区元丰大道1号 </p><p>注册资本：9600万元</p><p>公司成立时间：1995年</p><p>员工人数：1200人</p><p>工厂占地面积：25万平方米</p><p>机器数量及类型：日本丰田喷气织机800台，其中包括四喷多臂机108台，丰田整浆并5套，倍捻机100台，棉浆车2套</p><p>优势产品：弹力布</p><p>浙江元丰纺织股份有限公司,位于中国纺织名镇―嘉兴市王江泾。公司占地面积25万平方米,总投资8亿元人民币。 现有职工1200人，其下属分有嘉兴市元丰纺织有限公司,嘉兴市锦丰染整有限公司。公司拥有日本进口丰田喷气织机800台（其中四喷多臂机108台）；丰田整浆并5套,倍捻机100台等织造设备; 韩国进口溢流染色机88台,定型机10台,轧染生产线2条等染整设备。 公司荣获浙江省AAA信誉企业称号,是浙江省重点立项发展企业。公司主要生产经营:女装弹力裤料（锦棉,涤棉交织弹力布,斜纹，网纹弹力布,四面弹）；休闲时装面料（钻石棉系列，仿天丝棉系列，竹节系列，灯芯绒）等各类中高档休闲服装面料。 公司捅有专业的技术部，资深的市场调查部，以灵敏的市场嗅觉走在流行面料的前沿，以优质的品质主导市场潮流，以饱满的热情与真诚的服务迎接五湖四海的朋友！</p><p><span style=\"font-family:SimSun;FONT-SIZE: 14px\"><span style=\"font-family:SimSun;FONT-SIZE: 14px\">网址：<a href=\"http://www2.pibu.cc/space/yuanfengfangzhi\">http://www2.pibu.cc/space/yuanfengfangzhi</a></span></span></p>',',,,,,',79,NULL),
