	(791,2852,'苏州市鑫鸣纺织有限公司',NULL,NULL,1,2,3,'江苏省吴江市盛泽镇中国东方丝绸市场和服商区B栋16号','86','512','63521665','86','512','63515681','沈先生','13906256665','<div style=\"PADDING-LEFT: 10px; PADDING-RIGHT: 10px\" class=\"info-body\"><p>苏州市鑫鸣纺织有限公司位于中国四大绸都之一&quot;江苏吴江盛泽镇&quot;,企业成立于2000年，其同属工厂为吴江南麻鑫佳网络厂，是一家集纺织品网络、倍捻、整经、织造、生产、贸易为一体的中小型民营企业。公司以外贸出口为龙头，注重创新，开发新品。通过多年的生产管理经验及科学理念，已成为一家现代化的纺织企业。 <br />&nbsp; &nbsp;企业拥有先进的生产设备，首期投资3000多万元的吴江南麻鑫佳网络厂建筑面积1万平方米。本厂拥有全进口的一条龙生产线:日本津田驹500型分条整经设备2套、zw405喷水织机及倍捻机180台，年产各类面料1200万米。在结构、产能、技术上都已经达到先进水平。 <br />&nbsp; &nbsp;鑫鸣纺织企业生产化纤仿真丝类、加捻系列等。主要产品有：雪纺、复合丝雪纺、加捻色丁、仿记忆布、佐继麻、千格麻、双打麻、水洗绒、牛津布等，配有涂层、提花、绣花等。公司凭借“以人为本，品质优先”的生产经营理念赢得了国内外客户的青睐，产品远销美国、日本、欧盟、香港等国家和地区。 <br />&nbsp; &nbsp;我们将在企业理念指引下，继续加强产品开发，不断推出新产品，以一流的产品质量、一流的服务水平满足国内外客户的需要！ </p><p>&nbsp;</p></div>','131,,,,,',79,NULL),
